/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './personal.css';
import right from '../../images/personal/right.png';
import avatar from '../../images/personal/avatar.jpg';
import sale from '../../images/personal/sale.png';
import buy from '../../images/personal/buy.png';
import publish from "../../images/personal/publish.png";
import modify from '../../images/personal/modify.png';
import find from '../../images/personal/find.png';
import {Title, List,Button} from '../../share';
import {getData, goNext} from '../../utils';
const Item = List.Item;
export default class MessageList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            info:[
                {anotherCustomerNickName:"我发布的",anotherUserAvatar:[avatar],latestMessage:"还在吗",latestSendTime:"2019-09-23 12:09"},
                {anotherCustomerNickName:"我卖出的",anotherUserAvatar:[sale],latestMessage:"要不要",latestSendTime:"2019-09-23 12:09"},
                {anotherCustomerNickName:"我买到的",anotherUserAvatar:[buy],latestMessage:"还在吗",latestSendTime:"2019-09-23 12:09"},
                {anotherCustomerNickName:"修改密码",anotherUserAvatar:[modify],latestMessage:"还在吗",latestSendTime:"2019-09-23 12:09"}
            ]
        }
    }

    goDetail() {
        goNext(this, 'login');
    }
    goLogin(){
        getData({
            method: 'post',
            url: 'messageList',
            data: {},
            successCB: (res) => {
                localStorage.removeItem("userInfo");
                localStorage.removeItem("token");
                goNext(this, 'login');
            }
        })
    }
    render() {
        var user = JSON.parse(localStorage.getItem("userInfo"))||{};
        console.log(user);
        return <div>
            <Title title="消息" isHome={true}/>
            <div className="cm-mlr-10">
                {this.state.info.map((item,index)=>{
                    return(
                    <div className="cm-flex cm-ai-c" key={index} onClick={()=>this.goDetail()}>
                        <img src={item.anotherUserAvatar} alt="" className="message-img-40 cm-mr-10"/>
                        <div className="cm-flex cm-ai-c cm-jc-sb cm-width-full cm-border-bottom-gary cm-ptb-10">
                        <div>
                            <div className="cm-c-333 cm-fw-bold cm-fs-15">{item.anotherCustomerNickName}</div>
                            <div className="cm-c-999 cm-fs-14 cm-mt-05">{item.latestMessage}</div>
                            <div className="cm-c-999 cm-fs-10 cm-mt-10">{item.latestSendTime}</div>
                        </div>
                            <img src={item.leftIcon} alt="" className="message-img-60"/>
                        </div>
                    </div>
                    )
                })}
            </div>
        </div>
    }
}
